using Microsoft.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore.Metadata.Builders;
using FoodEx.Data.Entity; // assuming Restaurant is here

namespace FoodEx.Data.Configurations
{
    public class RestaurantConfiguration : IEntityTypeConfiguration<Restaurant>
    {
        public void Configure(EntityTypeBuilder<Restaurant> builder)
        {
            builder.HasMany(r => r.Foods)
                .WithOne(f => f.Restaurant)
                .HasForeignKey(f => f.RestaurantId)
                .OnDelete(DeleteBehavior.Cascade);

            builder.HasData(
                new Restaurant
                {
                    RestaurantId = 1,
                    Name = "Gourmet Paradise",
                    Location = "123 Main St, Food City",
                    Phone = "555-1234",
                    OwnerUserId = "restaurant-user-id",
                    ImageURL = "data:image/jpeg;base64,"
                },
                new Restaurant
                {
                    RestaurantId = 2,
                    Name = "Pizzeria Bella",
                    Location = "456 Pizza Lane, Food City",
                    Phone = "555-5678",
                    OwnerUserId = "restaurant-owner-2",
                    ImageURL = "data:image/jpeg;base64,"
                },
                new Restaurant
                {
                    RestaurantId = 3,
                    Name = "Burger House",
                    Location = "789 Burger Blvd, Food City",
                    Phone = "555-9876",
                    OwnerUserId = "restaurant-owner-3",
                    ImageURL = "data:image/jpeg;base64,"
                }
            );
        }
    }
}
